import React from 'react';

const Placeholder = () => {
    return (
        <div style={{
            width: 300,
            height: 500,
            backgroundColor: "rgba(253, 88, 0, .20)", 
            backdropFilter: "blur(5px)",
            borderRadius: "15px",
            boxShadow:"0 1px 3px rgba(253, 88, 0, 0.3), 0 0 20px rgba(253, 88, 0, 0.1) inset",
            margin: "auto"

        }}>

        </div>
    );
};

export default Placeholder;
